import React, { Component } from 'react'
import './Nav.css'
import { Link } from 'react-router-dom'

class LogoutNav extends Component {
  componentDidMount() {
    const M = window.M
    document.addEventListener('DOMContentLoaded', function () {
      var elems = document.querySelectorAll('.sidenav')
      var instances = M.Sidenav.init(elems, { edge: 'right' })
    })
  }

  render() {
    return (
      <div>
        <nav>
          <div className="nav-wrapper deep-orange lighten-1">
            <Link
              href="#"
              data-target="slide-out"
              className="sidenav-trigger show-on-large"
            >
              <i className="material-icons">menu</i>
            </Link>

            <Link
              style={{ color: '#ff5722', textDecoration: 'none' }}
              to="/menu"
            >
              <h3>Fithabit</h3>
            </Link>
            <ul>
              <Link
                style={{
                  color: '#ff5722',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/squat-ranking"
              >
                <li>Ranking</li>
              </Link>
              <Link
                style={{
                  color: '#ff5722',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/my-records"
              >
                <li>Record</li>
              </Link>
              <Link
                style={{
                  color: '#ff5722',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
                to="/profile"
              >
                <li>Profile</li>
              </Link>
              <Link
                to="/login"
                style={{
                  color: '#ff5722',
                  textDecoration: 'none',
                  listStyle: 'none',
                  fontSize: '20px',
                }}
              >
                <li>Login</li>
              </Link>
            </ul>
          </div>
        </nav>
      </div>
    )
  }
}

export default LogoutNav
